import React, { Component } from 'react'

export default class Newsitem extends Component {
    render() {
        let {title, description, imageURL, newsURL, author, date} = this.props
        return (
            <div className='my-3'>
                <div className="card" >
                <img src={imageURL?imageURL:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTr6J-djC5ckcPF69XacUQj5XrPnUFPxgp1bQ&usqp=CAU.jpg"} className="card-img-top" alt="..." />
                <div className="card-body">
                <h5 className="card-title">{title}...</h5>
                <p className="card-text">{description}..</p>
                <p class="card-text"><small class="text-muted">Written by {author} on {date}</small></p>
                <a rel="noreferrer" href={newsURL} target="_blank" className="btn btn-sm btn-dark">Learn More</a>
                </div>
                </div>
            </div>
        )
    }
}
